import React from 'react';
import Slider from "react-slick";
import podcastImage1 from '../assets/podcast1.jpg';
import podcastImage2 from '../assets/podcast2.jpg';
import podcastImage3 from '../assets/podcast3.jpg';
import '../index.css';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


const ProjectSlider = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        nextArrow: <SampleNextArrow />,
        prevArrow: <SamplePrevArrow />
    };

    return (
        <section className="project-zone">
            <Slider {...settings}>
                <div>
                    <img src={podcastImage1} alt="Podcast Zone 1" />
                    <div className="carousel-caption-project">
                        <div className="caption-text">
                            <h3>AITU Podcast 1</h3>
                            <p>Описание подкаста 1</p>
                        </div>
                        <a href="https://www.instagram.com/mediastudio.kz?igsh=c2VmNGgwOTIzeWx2" className="project-book">Смотреть</a>
                    </div>
                </div>
                <div>
                    <img src={podcastImage2} alt="Podcast Zone 2" />
                    <div className="carousel-caption-project">
                        <div className="caption-text">
                            <h3>AITU Podcast 2</h3>
                            <p>Описание подкаста 2</p>
                        </div>
                        <a href="https://www.instagram.com/mediastudio.kz?igsh=c2VmNGgwOTIzeWx2" className="project-book">Смотреть</a>
                    </div>
                </div>
                <div>
                    <img src={podcastImage3} alt="Podcast Zone 3" />
                    <div className="carousel-caption-project">
                        <div className="caption-text">
                            <h3>AITU Podcast 3</h3>
                            <p>Описание подкаста 3</p>
                        </div>
                        <a href="https://www.instagram.com/mediastudio.kz?igsh=c2VmNGgwOTIzeWx2" className="project-book">Смотреть</a>
                    </div>
                </div>
            </Slider>
        </section>
    );
};

function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
        <div
            className={className}
            style={{ ...style, display: "block", background: "black" }}
            onClick={onClick}
        />
    );
}

function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
        <div
            className={className}
            style={{ ...style, display: "block", background: "black" }}
            onClick={onClick}
        />
    );
}

export default ProjectSlider;
